import React from 'react';
import './App.css';
import Tabs from '../Tabs/Tabs'
import Tab from '../Tabs/Tab'


function App() {
  return (
    <Tabs>
      <Tab title="Lemon">Lemon is yellow</Tab>
      <Tab title="Strawberry">Strawberry is red</Tab>
      <Tab title="Pear">Pear is green</Tab>
    </Tabs>
  )
}

export default App;
